    // Función para realizar la búsqueda y mostrar los resultados
    function performSearch(query) {
        const filteredResults = simulatedResults.filter(result => {
            return result.title.toLowerCase().includes(query.toLowerCase());
        });

        displaySearchResults(filteredResults);
    }

    // Función para mostrar los resultados de búsqueda en el HTML
    function displaySearchResults(results) {
        // Limpiar resultados anteriores
        searchResults.innerHTML = '';

        // Construir elementos HTML para cada resultado
        results.forEach(result => {
            const resultElement = document.createElement('div');
            resultElement.classList.add('search-result'); // Clase base para todos los resultados

            // Aplicar estilo específico si el título es 'Boku no Hero Academia 7th Season'
            if (result.title === 'Boku no Hero Academia 7th Season') {
                resultElement.classList.add('boku-no-hero'); // Clase específica para Boku no Hero
            }

            resultElement.innerHTML = `
            <img src="${result.img}" alt="${result.title}">
            <a href="${result.url}" class="text-blue-600">${result.title}</a>
        `;
            searchResults.appendChild(resultElement);
        });

        // Mostrar contenedor de resultados solo si hay resultados
        if (results.length > 0) {
            searchResults.style.display = 'block'; // Mostrar resultados
        } else {
            searchResults.style.display = 'none'; // Ocultar resultados si no hay coincidencias
        }
    }

    // Evento de escucha para la entrada de búsqueda
    searchInput.addEventListener('input', function() {
        const query = searchInput.value.trim();
        if (query === '') {
            searchResults.style.display = 'none'; // Ocultar resultados si el campo de búsqueda está vacío
        } else {
            performSearch(query);
        }
    });